r($,"aNM","axI",()=>{var q=u.v,p="Shiraz University of Medical Sciences",o=t.N,n=t.z
return A.a([A.ac(["authors","Nuryani, Nuryani; Utomo, Trio Pambudi; Prabowo, Nurhasan Agung; Aripriharta; Yazid, Muhammad; Yunianto, Mohtar;","title","Advancing Non-Cuff Hypertension Detection: Leveraging 1D Convolutional Neural Network and Time Domain Physiological Signals","volume","20","number","05","pages","","year","2024","publisher","International Journal of Online and Biomedical Engineering (iJOE)","keywords","Hypertension (HT) Detection; Electrocardiogram (ECG); Photoplethysmogram (PPG); Convolutional Neural Network (CNN); non-cuff methods;","link","https://doi.org/10.3991/ijoe.v20i05.45547","abstract","Timely identification of hypertension (HT) is crucial for effectively managing and reducing the potential health consequences, including cardiovascular events such as heart attacks and strokes, as well as the development of kidney disease. Traditional cuff-based devices often discourage regular monitoring because they cause discomfort. Furthermore, the lack of symptoms in HT complicates the early detection of this condition. To address these challenges, our study employs a non-cuff methodology that utilizes unprocessed electrocardiogram (ECG) and photoplethysmogram (PPG) signals. We utilize a customized approach to enhance the features of a one-dimensional convolutional neural network (CNN) specifically tailored to optimize timeseries data. In contrast to previous research, our methodology avoids the need for complex signal extraction or transformation techniques. The main goal is to identify the optimal input signals and fine-tune the critical hyperparameters of CNNs. The clinical data underwent analysis, which revealed that the use of an integrated ECG and PPG approach resulted in the highest level of accuracy for detection. Notably, the F1 score achieved an impressive value of 98.88%. When evaluated separately, ECG outperformed PPG. Our study contributes to the advancement of the field by introducing a new approach that combines comfort and high accuracy in the early detection of HT. This method is practical and ensures a patient-friendly experience."],o,n),A.ac(["authors",u.m,"title",u.a,"publication",q,"volume","","number","","pages","","year","2023","publisher",p,"keywords",u.z,"link",u._,"abstract","Background: Hypertension is associated with severe complications, and its detection is important to provide early information about a hypertension event, which is essential to prevent further complications. Objective: This study aimed to investigate a strategy for hypertension detection without a cuff using parameters of bioelectric signals, i.e., Electrocardiogram (ECG), Photoplethysmogram (PPG,) and an algorithm of Swarm-based Support Vector Machine (SSVM). Material and Methods: This experimental study was conducted to develop a hypertension detection system. ECG and PPG bioelectrical records were collected from the Medical Information Mart for Intensive Care (MIMIC) from normal and hypertension participants and processed to find the parameters, used for the inputs of SSVM and comprised Pulse Arrival Time (PAT) and the characteristics of PPG signal derivatives. The SSVM was n Support Vector Machine (SVM) algorithm optimized using particle swarm optimization with Quantum Delta-potential-well (QDPSO). The SSVMs with different inputs were investigated to find the optimal detection performance.  Results: The proposed strategy was performed at 96% in terms of F1-score, accuracy, sensitivity, and specificity with better performance than the other methods tested and methods and also could develop a cuff-free hypertension monitoring system. Conclusion: Hypertension using SSVM, ECG, and PPG parameters is acceptably performed. The hypertension detection had lower performance utilizing only PPG than both ECG and PPG."],o,n),A.ac(["authors",u.l,"title",u.g,"publication",q,"volume","12","number","6","pages","627-636","year","2022","publisher",p,"keywords",u.A,"link",u.y,"abstract","Background: Obstructive Sleep Apnea (OSA) is a respiratory disorder due to obstructive upper airway (mainly in the oropharynx) periodically during sleep. The common examination used to diagnose sleep disorders is Polysomnography (PSG). Diagnose with PSG feels uncomfortable for the patient because the patient's body is fitted with many sensors. Objective: This study aims to propose an OSA detection using the Fast Fourier Transform (FFT) statistics of electrocardiographic RR Interval (R interval from one peak to the peak of the pulse of the next pulse R) and machine learning algorithms. Material and Methods: In this case-control study, data were taken from the Massachusetts Institute of Technology at Beth Israel Hospital (MIT-BIH) based on the Apnea ECG database (RR Interval). The machine learning algorithms were Linear Discriminant Analysis (LDA), Artificial Neural Network (ANN), K-Nearest Neighbors (K-NN), and Support Vector Machine (SVM). Results: The OSA detection technique was designed and tested, and five features of the FFT were examined, namely mean (f1), Shannon entropy (f2), standard deviation (f3), median (f4), and geometric mean (f5). The OSA detection found the highest performance using ANN. Among the ANN types tested, the ANN with gradient descent backpropagation resulted in the best performance with accuracy, sensitivity, and specificity of 84.64%, 94.21%, and 64.03%, respectively. The lowest performance was found when LDA was applied. Conclusion: ANN with gradient-descent backpropagation performed higher than LDA, SVM, and KNN for OSA detection."],o,n),A.ac(["authors",u.k,"title",u.L,"publication",u.d,"volume","11","number","5","pages","641","year","2021","publisher",p,"keywords",u.R,"link",u.t,"abstract",u.s],o,n)],t.H7)})
